window.bookSummaryJSON = "<p><b>Jax Bremen is an outlaw...sort of. </b></p> <p>Within the L, a tri-star system located inside the Aquilian Nebula, Jax makes a living trading and smuggling whatever goods pay the best. So far, he’s avoided being caught with anything too damning in his ship’s holds, but when he takes a job for Korinth, an infamous arms dealer, all that changes.&nbsp;</p> <p>The haul is worth 10 times his ship, and when the contents gets him embroiled in a tug of war between the major political factions of the L, Jax has to keep the criminals he works for from discovering that he’s playing both sides. Hell, he just might have to play all the sides to navigate the tangled web he’s in.&nbsp;</p> <p>Every move he makes to get free of the quagmire draws him in deeper until Jax finds himself on the hook to run the hardest job he’s ever undertaken: rob the <i>Daedalus</i>, a military cruiser escorting a convoy through the Maelstrom.&nbsp;</p> <p>Sure. Cakewalk, right?&nbsp;</p> <p><b>Grab the explosive first book in a new space opera thrill ride from </b><b><i>NYT</i></b><b> best-selling author M.D. Cooper. It's perfect for fans of Elizabeth Moon, Ken Lozito, and Craig Alanson. </b></p>"; 
